  true,\n\t\"url\": null,\n\t\"notes\": \"Under Public Law 102-321, the Department
  of Treasury is required to produce annual estimates of Total Taxable Resources (TTR),
  Treasury's estimates of the relative fiscal capacity of the states. TTR was developed
  as an outgrowth of a Congressionally mandated study on Federal, State, and local
  government fiscal relations entitled \"Federal-Sate-Local Fiscal Relations: Technical
  Papers, Vol. 2, Office of State and Local Finance, Department of Treasury, September
  1986\".\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
